description:
The Hess Enigma

War Documentary hosted by Allan Corduner, published by National Geographic broadcasted as part of NG Nazi Underworld series in 2012 - English narration


Information
------------------------------

Investigating the life of leading Nazi Rudolf Hess, including his solo missions, political allegiances and his mysterious death in prison

